time:
Společnost LitFin, přední specialista v investování do soudních sporů ve střední a východní Evropě, hledá do svého týmu studenta či studentku vysoké školy na pozici administrativního asistenta.

Pracovní náplň:

podílení se na procesu zpracovávání podkladů v rámci našich různých kauz (např. kontrola kompletnosti podkladů zaslaných klienty, kontrola výstupních hodnot apod.)

práce s interním systémem, zadávání a kontrola dat;

komunikace s klienty - mailem i telefonicky;

plnění dílčích úkolů projektu a jejich následný reporting.
